import React from "react";
import {
  LayoutDashboard,
  MessageSquare,
  CalendarDays,
  FileUp,
  Workflow,
  ClipboardList,
  LogOut,
  UsersRound,
  X,
  ChevronRight,
  Terminal,
} from "lucide-react";
import { useNavigate, useLocation } from "react-router-dom";
import { motion, AnimatePresence } from "framer-motion";

interface SidebarProps {
  isOpen: boolean;
  onClose: () => void;
}

const Sidebar: React.FC<SidebarProps> = ({ isOpen, onClose }) => {
  const navigate = useNavigate();
  const location = useLocation();

  const navItems = [
    { label: "Dashboard", icon: LayoutDashboard, path: "/dashboard" },
    { label: "Issues", icon: ClipboardList, path: "/tasks" },
    { label: "Discussions", icon: MessageSquare, path: "/chat" },
    { label: "Teams", icon: UsersRound, path: "/meetings" },
    { label: "Roadmap", icon: CalendarDays, path: "/calendar" },
    { label: "Documentation", icon: FileUp, path: "/files" },
    { label: "Workflows", icon: Workflow, path: "/workflows" },
  ];

  return (
    <>
      <AnimatePresence>
        {isOpen && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="fixed inset-0 bg-[#000000]/10 backdrop-blur-[2px] z-40 lg:hidden"
            onClick={onClose}
          />
        )}
      </AnimatePresence>

      <aside
        className={`
          fixed top-0 left-0 z-50 h-screen w-64 bg-white border-r border-[#e2e2e4]
          transform transition-transform duration-300 ease-[0.19,1,0.22,1]
          ${isOpen ? "translate-x-0" : "-translate-x-full"}
          lg:translate-x-0 flex flex-col
        `}
      >
        {/* Brand Section */}
        <div
          className="p-6 pb-8 flex items-center gap-3 cursor-pointer"
          onClick={() => {
            navigate("/dashboard");
            onClose();
          }}
        >
          <div className="w-8 h-8 bg-[#111113] rounded-lg flex items-center justify-center shadow-md">
            <img src="/logo1.png" alt="Logo" className="w-5 h-5 invert" />
          </div>
          <div className="flex flex-col">
            <h1 className="text-sm font-bold tracking-tight text-[#111113]">Collabryta</h1>
            <span className="text-[10px] font-medium text-slate-400">Software</span>
          </div>
        </div>

        {/* Navigation */}
        <nav className="flex-1 px-3 space-y-0.5 overflow-y-auto custom-scrollbar">
          <div className="px-3 mb-2">
            <span className="text-[10px] font-bold uppercase tracking-widest text-slate-400">Main</span>
          </div>
          {navItems.map(({ label, icon: Icon, path }) => {
            const active = location.pathname === path;
            return (
              <button
                key={path}
                onClick={() => {
                  navigate(path);
                  onClose();
                }}
                className={`w-full flex items-center justify-between px-3 py-1.5 rounded-lg text-sm font-medium transition-all relative group
                  ${active
                    ? "bg-[#5e6ad2]/5 text-[#5e6ad2]"
                    : "text-slate-500 hover:text-[#111113] hover:bg-slate-100/60"
                  }`}
              >
                <div className="flex items-center gap-2.5">
                  <Icon size={16} className={`${active ? "text-[#5e6ad2]" : "text-slate-400 group-hover:text-slate-600"} transition-colors`} />
                  {label}
                </div>
                <div className="flex items-center">
                  {active && (
                    <motion.div
                      layoutId="linearIndicator"
                      className="w-1 h-3 bg-[#5e6ad2] rounded-full"
                    />
                  )}
                  {/* Keyboard Shortcut Placeholder */}
                  {!active && <span className="text-[10px] text-slate-300 opacity-0 group-hover:opacity-100 transition-opacity ml-2">G {label[0]}</span>}
                </div>
              </button>
            );
          })}
        </nav>

        {/* Footer Action */}
        <div className="p-4 border-t border-[#e2e2e4]/60">
          <motion.button
            whileHover={{ backgroundColor: "rgba(0,0,0,0.03)" }}
            onClick={() => navigate("/login")}
            className="w-full flex items-center gap-2.5 px-3 py-2 text-slate-500 rounded-lg text-sm font-medium transition-all group"
          >
            <div className="p-1 px-1.5 bg-slate-100 rounded text-[10px] font-bold text-slate-500 border border-slate-200">‚å• L</div>
            Log Out
          </motion.button>
        </div>
      </aside>
    </>
  );
};

export default Sidebar;
